CREATE SEQUENCE ShalomAnimalsDBC.PersonSeq as  bigint
  START WITH 100
  INCREMENT BY 1
  MINVALUE 1
  NO MAXVALUE
  NO CYCLE
  CACHE 10;

  IF OBJECT_ID('PersonTbl','U')IS NOT NULL
 DROP TABLE PersonTbl
 create table PersonTbl
 (
  personid BIGINT PRIMARY KEY not null DEFAULT (NEXT VALUE FOR ShalomAnimalsDBC.PersonSeq),
  personname      varchar (30) not null,
  personSurname   varchar (30) not null,
  personGender    varchar (30) not null,
  personDOB       varchar (30) not null,
  cityid          BIGINT references cityTbl(cityid) not null,
  countryID       BIGINT references countryTbl(countryid) not null,
  loginUname      varchar (30) not null,
  loginPass       varchar (30) not null,
  RegSeq          varchar (10) not null
 )
